import '../styling/AboutMe.css'
import ImageUploader from 'react-images-upload';
import graduation from "./drawings/graduation.png";

const AboutMe = () => {

    const state = () => {
        this.facts = "",
        this.hobby = "",
        this.interest = ""
    }



    return (
        <div>
            <link rel="stylesheet" href="AboutMe.css"/>
            <div class="AboutMePage">

                <div class="Information">
                    <div class="MyInfo" id="fact"> 
                        <div class="facts" id="firstfact" style={ {backgroundColor: "green"}}></div>
                        <div class="facts" id="secondfact" style={ {backgroundColor: "red"}}></div>
                        <div class="facts" id="thirdfact" style={ {backgroundColor: "yellow"}}></div>                    
                    </div>

                    <div class="MyInfo" id="hobby">My Hobbies</div>
                    <div class="MyInfo" id="interest">My Interest</div>
                </div>
                <div class="Information">
                    <div class="buttons">
                        <button id="factButton"></button>
                        <button></button>
                        <button></button>
                    </div>
                </div>

            </div>

        </div>
    )

};

export default AboutMe;
